import React from 'react';
import styled from "styled-components";

const Container = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    min-height: 100vh;
    background-color: #F1F1DE;
    box-sizing: border-box;
`;

const Title = styled.p`
    font-size: 40px;
    font-style: 'Pretendard-ExtraBold';
`;


const InitialPage = () => {
    const KAKAO_AUTH_URL = "/home" // 임시 경로, 이후 수정 필요

    return (
        <Container>
            <Title>TRIPBEATS</Title>
            <a href={KAKAO_AUTH_URL} className="kakaobtn">
                <img style={{width: "130px", boxShadow: "0 0 1px rgba(0,0,0,0.1)", borderRadius: "5px"}}
                src={process.env.PUBLIC_URL + `asset/kakao_login.png`} />
            </a>
        </Container>
    );
};

export default InitialPage;
